import logo from './assets/images/logo.svg';
import './assets/css/App.css';

import Header from './components/Header';
import Slider from './components/Slider';
import Sidebar from './components/Sidebar';



function App() {
  return (
    <div className="App">

      <Header/>

      <Slider/>

      <Sidebar/>



      <div className="center">

        <section id="content">






        </section>






      </div>



    </div>
  );
}

export default App;
